import React, { Component } from 'react';
import ReactGA from 'react-ga';
import $ from 'jquery';
import 'antd/dist/antd.css';
import './App.css';
import {connect} from 'react-redux';
import Header from './Components/Header';
import Footer from './Components/Footer';
import About from './Components/About';
import Login from './Components/Login';
import Contact from './Components/Contact';
import Portfolio from './Components/Portfolio';
import ProductGridView from './containers/ProductGridView';
import ShopProduct from './Components/Shop';
import * as actions from './actions/auth';

class App extends Component {

  constructor(prop){
    super(prop);
    this.state = {
      foo: 'bar',
      resumeData: {}
    };

    ReactGA.initialize('UA-110570651-1');
    ReactGA.pageview(window.location.pathname);

  }

  getResumeData(){
    $.ajax({
      url:'./resumeData.json',
      dataType:'json',
      cache: false,
      success: function(data){
        this.setState({resumeData: data});
      }.bind(this),
      error: function(xhr, status, err){
        console.log(err);
        alert(err);
      }
    });
  }

  componentDidMount(){
    this.getResumeData();
    this.props.onAutoSignup();
  }

  render() {
    return (
      <div className="App">
        <Header {...this.props} data={this.state.resumeData.main } />
        <ShopProduct data={this.state.resumeData.ShopProduct}/>
        <About data={this.state.resumeData.main}/>
        <Login data={this.state.resumeData.main}/>
        <Portfolio data={this.state.resumeData.portfolio}/>
        <Contact data={this.state.resumeData.main}/> 
        <Footer data={this.state.resumeData.main}/>

      </div>
    );
  }
}

const mapStateToProps = state => {
  return{
    isAuthenticated: state.token !== null

  }
}

const mapDispatchToProps = dispatch => {
  return{
    onAutoSignup: () => dispatch(actions.checkState())
  }
}

export default connect(mapStateToProps,mapDispatchToProps)(App);
